import React from 'react';
import './ExplorerPage.css';

const categories = [
  { icon: 'üåç', title: 'Orte entdecken', description: 'Entdecke neue Orte in deiner Umgebung.' },
  { icon: 'üéâ', title: 'Aktivit√§ten & Events', description: 'Finde spannende Aktivit√§ten und Events.' },
  { icon: 'üë•', title: 'Gruppen & Meetups', description: 'Tritt Gruppen bei und nimm an Meetups teil.' },
  { icon: '‚≠ê', title: 'Wunschliste', description: 'Speichere deine Lieblingsorte und Aktivit√§ten.' }
];

function ExplorerPage() {
  return (
    <div className="explorer-page">
      <h1 className="explorer-title">Entdecke</h1>
      <div className="explorer-grid">
        {categories.map((category, index) => (
          <div key={index} className="explorer-tile">
            <span className="explorer-icon">{category.icon}</span>
            <h2 className="explorer-category-title">{category.title}</h2>
            <p className="explorer-description">{category.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ExplorerPage;
